  false,\n\t\"url\": null,\n\t\"notes\": \"This study of recreational users of arctic
  Alaska was conducted to identify the impacts of increased use on the visitor experience
  and the resources of the Arctic National Wildlife Range. A total of 847 registrations
  were received from 594 individuals. 493 registrations were received from known recreationists.
  Hunting guides registered 52 hunters. From this group of hunters, 29 also registered
  at other locations. This ratio was used to estimate the total number of hunters,
  yielding an estimate of 267 hunters in the Arctic National Wildlife Range in 1977.\",\n\t\"owner_org\":
